import React from 'react';
import './Login.css';
import { Button } from "@material-ui/core";

function Login() {
    return (
        <div className="login">
            <div className="login_logo">
                <img src="https://i.imgur.com/dhf1w4L.png" alt=""></img>
                <h2>HactuallyChat</h2>
            </div>


            <Button>Sign In</Button>
        </div>
    )
}

export default Login;
